description:
It was discovered that the HugeTLB file system component of the Linux
Kernel contained a NULL pointer dereference vulnerability. A privileged
attacker could possibly use this to to cause a denial of service.
(CVE-2024-0841)

Several security issues were discovered in the Linux kernel.
An attacker could possibly use these to compromise the system.
This update corrects flaws in the following subsystems:
  - ARM32 architecture;
  - PowerPC architecture;
  - x86 architecture;
  - DMA engine subsystem;
  - EFI core;
  - GPU drivers;
  - InfiniBand drivers;
  - Multiple devices driver;
  - Network drivers;
  - Power supply drivers;
  - TCM subsystem;
  - Userspace I/O drivers;
  - USB subsystem;
  - Framebuffer layer;
  - AFS file system;
  - File systems infrastructure;
  - BTRFS file system;
  - Ext4 file system;
  - Bluetooth subsystem;
  - Networking core;
  - IPv4 networking;
  - IPv6 networking;
  - L2TP protocol;
  - MAC80211 subsystem;
  - Netfilter;
  - Netlink;
  - Wireless networking;
